import React from "react";

import Card from "../Card/Card";
import DivideNumberIntoСategory from "../DivideNumberIntoСategory";
import styles from "./Order.module.scss";

const Order = ({date, item, totalPrice, orderId}) => {
  let n = date.toString();
  n.replace(/^(?:(?:31(\/|-|\.)(?:0?[13578]|1[02]))\1|(?:(?:29|30)(\/|-|\.)(?:0?[1,3-9]|1[0-2])\2))(?:(?:1[6-9]|[2-9]\d)?\d{2})$|^(?:29(\/|-|\.)0?2\3(?:(?:(?:1[6-9]|[2-9]\d)?(?:0[48]|[2468][048]|[13579][26])|(?:(?:16|[2468][048]|[3579][26])00))))$|^(?:0?[1-9]|1\d|2[0-8])(\/|-|\.)(?:(?:0?[1-9])|(?:1[0-2]))\4(?:(?:1[6-9]|[2-9]\d)?\d{2})$/);
  console.log();
  return (
    <div>
      <div className={styles.top}>
        <h2>Заказ # </h2>
        <span>{orderId}</span>
      </div>
      <div className={styles.order}>
        {item.map((obj) => (
          <Card
            key={obj._id}

            title={obj.title}
            imgURL={obj.imgURL}
            description={obj.description}
            price={obj.price}
          ></Card>
        ))}
      </div>
      <div className={styles.price}>
      <h4>
        Общая стоимость заказа (с учётом доставки и скидки):{" "}
      </h4>
      <span> {totalPrice}</span>
      <b>руб.</b>
      </div>
      <div className={styles.price}>
      <h4>
        Дата оформления заказа:{" "}
      </h4>
      <span> {date}</span>
      </div>
    </div>
  );
};

export default Order;
